import React, { Component } from 'react';
import Navigation from'./components/Navigation/Navigation';
import './App.css';

class App extends Component() {
  constructor(props){
    super(props)
    this.state= {
      isSignedIn: false,
      onRouteChange: 'landing'
    }
  }
  render()
  {
    return (
      <div className="App">
        <Navigation isSignedIn={this.state.isSignedIn} onRouteChange={this.state.onRouteChange}></Navigation>
      </div>
    );
  }
}

export default App;
